import React from "react";
import { View, StyleSheet, Image, TouchableOpacity, Text } from "react-native";
import MenuText from "./MenuText";

function Card(props) {
  return (
    <TouchableOpacity>
      <View>
        <Image style={styles.image} source={require("../assets/clip.png")} />
        <Text style={styles.text}> Clip 1</Text>
      </View>
    </TouchableOpacity>
  );
}

const styles = StyleSheet.create({
  image: {
    borderColor: "#fff",
    borderWidth: 3,
    resizeMode: "contain",
    width: "40%",
    height: 155,
    // marginLeft: "19%",
    // marginRight: "20%"
  },
  text: {
    textAlign: "center",
    color: "white",
    opacity: 1,
    fontSize: 15,
    fontWeight: "bold",
    color: "white",
    paddingTop: 20,
  },
});

export default Card;
